! Circular solid section (CS)
! Function returning reinforcement area (As)

function As_CS(d,c,fcd,N,M)

    implicit none

    real(kind=8) :: As_CS,d,c,fcd,N,M
    real(kind=8) :: cd,Ac,ni,mi,fyd

    cd = c/d
    Ac = 3.14159265358979323846*d*d/4
    ni = N/Ac/fcd
    mi = M/Ac/d/fcd
    fyd = 500000/1.15

    As_CS = w_CS(cd,ni,mi)*Ac*fcd/fyd

end function As_CS

