! Circular hollow section (CH)
! Function returning reinforcement area (As)

function As_CH(d,t,fcd,N,M)

    implicit none

    real(kind=8) :: As_CH,d,t,fcd,N,M
    real(kind=8) :: td,Ac,ni,mi,fyd

    td = t/d
    Ac = 3.14159265358979323846*(d*d-(d-2*t)*(d-2*t))/4
    ni = N/Ac/fcd
    mi = M/Ac/d/fcd
    fyd = 500000/1.15

    As_CH = w_CH(td,ni,mi)*Ac*fcd/fyd

end function As_CH

