! Rectangular solid section w/ equal reinforcement at each side (RSe)
! Function returning reinforcement area (As)

function As_RSe(b,h,c,fcd,N,Mx,My)

    implicit none

    real(kind=8) :: As_RSe,b,h,c,fcd,N,Mx,My
    real(kind=8) :: bh,cb,ni,mix,miy,fyd

    bh = b/h
    cb = c/b
    ni = N/b/h/fcd
    mix = Mx/b/h/h/fcd
    miy = My/b/b/h/fcd
    fyd = 500000/1.15

    As_RSe = w_RSe(bh,cb,ni,mix,miy)*b*h*fcd/fyd

end function As_RSe

