! Rectangular hollow section w/ equal reinforcement at each side (RHe)
! Function returning reinforcement area (As)

function As_RHe(b,h,t,fcd,N,Mx,My)

    implicit none

    real(kind=8) ::As_RHe,b,h,t,fcd,N,Mx,My
    real(kind=8) ::bh,tb,Ac,ni,mix,miy,fyd

    bh = b/h
    tb = t/b
    Ac = b*h - (b-2*t)*(h-2*t)
    ni = N/Ac/fcd
    mix = Mx/Ac/h/fcd
    miy = My/Ac/b/fcd
    fyd = 500000/1.15

    As_RHe = w_RHe(bh,tb,ni,mix,miy)*Ac*fcd/fyd

end function As_RHe

