! Rectangular solid section w/ distributed reinforcement (RSd) - NEW
! Function returning reinforcement area (As)

function As_RSd(b,h,c,fcd,N,Mx,My)

    implicit none

    real(kind=8) :: As_RSd,b,h,c,fcd,N,Mx,My
    real(kind=8) :: bh,ch,ni,mix,miy,fyd

    bh = b/h
    ch = c/h
    ni = N/b/h/fcd
    mix = Mx/b/h/h/fcd
    miy = My/b/b/h/fcd
    fyd = 500000/1.15

    As_Rsd = w_RSd(bh,ch,ni,mix,miy)*b*h*fcd/fyd

end function As_RSd

