! Rectangular hollow section w/ distributed reinforcement (RHd) - NEW
! Function returning reinforcement area (As)

function As_RHd(b,h,t,fcd,N,Mx,My)

    implicit none

    real(kind=8) :: As_RHd,b,h,t,fcd,N,Mx,My
    real(kind=8) :: bh,th,Ac,ni,mix,miy,fyd

    bh = b/h
    th = t/h
    Ac = b*h - (b-2*t)*(h-2*t)
    ni = N/Ac/fcd
    mix = Mx/Ac/h/fcd
    miy = My/Ac/b/fcd
    fyd = 500000/1.15

    As_RHd = w_RHd(bh,th,ni,mix,miy)*Ac*fcd/fyd

end function As_RHd

