! Tee section - NEW
! Function returning reinforcement area (As)

function As_T(beff,bw,h,hf,c,fcd,M,N)

    implicit none

    real(kind=8) :: As_T,beff,bw,h,hf,c,fcd,M
    real(kind=8) :: d,beffbw,hfd,A1,A2,ys1,Ms,mi,fyd

    real(kind=8),optional :: N

    d = h-c
    beffbw = beff/bw
    hfd = hf/d
    A1 = bw*(h-hf)
    A2 = beff*hf
    ys1 = (A1*(h-hf)/2+A2*(h-hf/2))/(A1+A2) - c

    if (present(N)) then
        Ms = M - N*ys1
    else
        Ms = M
    endif

    mi = Ms/beff/d/d/fcd
    fyd = 500000/1.15

    if (present(N)) then
        As_T = w_T(beffbw,hfd,mi)*beff*d*fcd/fyd + N/fyd
    else
        As_T = w_T(beffbw,hfd,mi)*beff*d*fcd/fyd
    endif

end function As_T

! Rectangular section - NEW
! Function returning reinforcement mechanical ratio (w)

function w_R(m)

    implicit none

    real(kind=8) :: w_R,m

    w_R = w_T(1.0d0,0.1d0,m)

end function w_R

! Rectangular section - NEW
! Function returning normalized compression flange depth (x)

function x_R(m)

    implicit none

    real(kind=8) :: x_R,m

    x_R = x_T(1.0d0,0.1d0,m)

end function x_R

! Rectangular section - NEW
! Function returning reinforcement area (As)

function As_R(b,h,c,fcd,M,N)

    implicit none

    real(kind=8) :: As_R,b,h,c,fcd,M
    real(kind=8) :: d,ys1,Ms,mi,fyd

    real(kind=8),optional :: N

    d = h-c
    ys1 = h/2-c

    if (present(N)) then
        Ms = M - N*ys1
    else
        Ms = M
    endif

    mi = Ms/b/d/d/fcd
    fyd = 500000/1.15

    if (present(N)) then
        As_R = w_R(mi)*b*d*fcd/fyd + N/fyd
    else
        As_R = w_R(mi)*b*d*fcd/fyd
    endif

end function As_R

